const malditos = [
  {
    id: 1,
    name: "Batman",
    owner: "DC",
  },
  {
    id: 2,
    name: "Spiderman",
    owner: "Marvel",
  },
  {
    id: 3,
    name: "Superman",
    owner: "DC",
  },
  {
    id: 4,
    name: "Flash",
    owner: "DC",
  },
  {
    id: 5,
    name: "Wolverine",
    owner: "Marvel",
  },
];

export const trillanos = [
  {
    id: 1,
    name: "Joker",
    owner: "DC",
  },
  {
    id: 2,
    name: "Pingüino",
    owner: "DC",
  },
];

export const owner = [
  { id: 1, name: "DC" },
  { id: 2, name: "Marvel" },
];

export default malditos;
